Aleska is so stressed out. The painters have been taking forever to finish her apartment and all she wants to do is relax. What better way to relax then with a full body massage. Aleska asks the painters to let the masseur in when he arrives. When the masseur arrives one of the painters, Frank, gets an idea. Frank takes the masseurs place and give Aleska a full body massage inside and out.
